import React, {Component} from "react";
import "./city.scss";


class City extends Component {

    showWindow = () => {
        return (
            <div className="cityWindow"> Dopłata z wyjazd z tego miast to: {this.props.addPayment}
                    Odjazd gwarantowany przy liczbie osób: 15
            </div>
        )
    };

    render() {
        let style = {
            position: "absolute",
            left: this.props.left,
            top: this.props.top
        };
        return (
                <div className="object-city" onMouseOver={this.showWindow} style={style}>{this.props.name}
                <div className="autokar-wrapper"></div>
                </div>
        )
    }
}

export default City;
